import axios from "axios";
import React, { useEffect } from "react";


export default function Img(){
    useEffect(()=>{
        axios.get('http://localhost:5555/Rooms')
          .then((res)=>{
            res.data.forEach(room => {
                console.log(room.url);
              });
          })
          .catch((err)=>console.log(err))
      }) 
}
